(async function () {
  const id = "lucky-wheel";

  const pinImage =
    "data:image/png;base64,";
  const wheelImage =
    "data:image/png;base64,";

  var game;
  var wheel;
  var canSpin;
  var prize;
  var prizeText;

  const slices = 8;
  const slicePrizes = [
    "A KEY!!!",
    "50 STARS",
    "500 STARS",
    "BAD LUCK!!!",
    "200 STARS",
    "100 STARS",
    "150 STARS",
    "BAD LUCK!!!",
  ];

  var container = document.createElement("div");
  container.id = id;
  document.body.appendChild(container);

  function loadScript(src) {
    return new Promise((resolve, reject) => {
      const script = document.createElement("script");
      script.src = src;
      script.onload = () => {
        console.log("Phaser loaded successfully.");
        resolve();
      };
      script.onerror = () => {
        console.error("Failed to load Phaser.");
        reject(new Error(`Failed to load script: ${src}`));
      };
      document.head.appendChild(script);
    });
  }

  // Load Phaser script
  await loadScript(
    "https://cdn.jsdelivr.net/npm/phaser@3.55.2/dist/phaser.min.js"
  );

  document.getElementById(id).innerHTML = `
      <div id="game-container" style="position: relative; width: 500px; height: 500px;"></div>
      <div class="prize-text" id="prizeText" style="color: black; text-align: center; font-size: 24px; margin-top: 10px;"></div>
  `;

  prizeText = document.getElementById("prizeText");

  // PreloadScene: Handles loading assets
  class PreloadScene extends Phaser.Scene {
		constructor() {
				super({ key: 'PreloadScene' });
		}

		preload() {
				console.log('Preloading images...');

				// Load images from Base64
				this.load.image('wheel', 'https://wheel-coupon-img.s3.amazonaws.com/wheel.png');
				this.load.image('pointer', 'https://wheel-coupon-img.s3.amazonaws.com/pin.png');

				// this.textures.addBase64('wheel', wheelImage);
        //     this.textures.addBase64('pointer', pinImage);

				// Listen for when all textures are added
				this.load.once('complete', () => {
						console.log('All assets are loaded.');
						this.scene.start('MainScene'); // Start the main scene
				});
		}

		create() {
				console.log('Preload scene complete.');
		}
}

  // MainScene: The main game scene
  class MainScene extends Phaser.Scene {
    constructor() {
      super({ key: "MainScene" });
    }

    create() {
      console.log("Creating main game scene...");

      // Verify if the textures are loaded
      if (this.textures.exists("wheel") && this.textures.exists("pointer")) {
        console.log("Textures are loaded successfully.");

        wheel = this.add.sprite(
          this.cameras.main.width / 2,
          this.cameras.main.height / 2,
          "wheel"
        );
        wheel.setOrigin(0.5);

        var pointer = this.add.sprite(
          this.cameras.main.width / 2,
          this.cameras.main.height / 2,
          "pointer"
        );
        pointer.setOrigin(0.5, 0.5);

        canSpin = true;
        this.input.on("pointerdown", spin, this);
      } else {
        console.error("Textures are not loaded.");
      }
    }
  }

  game = new Phaser.Game({
    type: Phaser.AUTO,
    width: 500,
    height: 500,
    scene: [PreloadScene, MainScene],
    parent: "game-container",
  });

  function spin() {
    if (canSpin) {
      prizeText.textContent = "";
      var rounds = Phaser.Math.Between(2, 4);
      var degrees = Phaser.Math.Between(0, 360);
      prize = slices - 1 - Math.floor(degrees / (360 / slices));
      canSpin = false;
      this.tweens.add({
        targets: wheel,
        angle: 360 * rounds + degrees,
        duration: 3000,
        ease: "Cubic.easeOut",
        callbackScope: this,
        onComplete: winPrize,
      });
    }
  }

  function winPrize() {
    canSpin = true;
    prizeText.textContent = slicePrizes[prize];
    console.log(slicePrizes[prize]);
  }

  window.spinWheel = function () {
    game.scene.scenes[0].spin();
  };
})();
